import React from 'react';
import ReactDOM from 'react-dom';

ReactDOM.render(
  <App />,
  document.getElementById('root')
);
function App() {
  return <main>
    <GeRandomColor><ItalicText>Hello</ItalicText></GeRandomColor><GeRandomColor><boldText>word</boldText></GeRandomColor>
  </main>;
}
function GeRandomColor(props){
  var randomColor = '#'+Math.floor(Math.random()*16777215).toString(16);
  return <h1 style={{color: randomColor}} >{props.children}</h1>;
}

function ItalicText(props) {
  return <i>
    {props.children}
  </i>;
}

function boldText(props) {
  return <b>
    {props.children}
  </b>;
}
